import React from 'react';

class Clock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      time: new Date().toLocaleDateString(),
    };
  }

  render() {
    return <h1>{this.state.time}</h1>;
  }
}

export default Clock;
